import React, { Component } from 'react';

import Header from '../header';
import SearchPanel from '../search-panel';
import FlightsTable from '../flights-table';
import YandexFlightsShedule from '../../services/yandex-flights-shedule';

import './app.css';

export default class App extends Component {

  apiService = new YandexFlightsShedule();

  state = {
  	flights: null
  }

  render() {
  	return (
	    <div className='app'>
	      <Header />
	      <SearchPanel />
	      <FlightsTable />
	    </div>
	  );
  }
};
